import { Link } from 'react-router-dom';

const NotLoggedIn = ({text}) => {
    return (
        <>
            <h1>You are not logged in.</h1>
            <h1>Please login or signup to {text}.</h1>
            <Link to="login">Login</Link>
            <Link to="signup">Signup</Link>
        </>
    )
}

export default NotLoggedIn;
